import React, { useEffect } from "react";
import styled, { css } from "styled-components";

type StateProps = {
    readonly state?: string;
};

const Main = styled.main<StateProps>`
    width: 100%;
    max-height: 100%;
    display: grid;
    overflow-y: auto;
    color: var(--on-secondary);
    ${(props) =>
        props.state === "entered"
            ? css`
                  visibility: visible;
                  opacity: 1;
                  transform: scale(1);
                  transition: 0.3s ease-out;
              `
            : props.state === "entering"
            ? css`
                  visibility: hidden;
                  opacity: 0;
                  transform: scale(0.9);
                  transition: 0.3s ease-in;
              `
            : css`
                  visibility: hidden;
                  opacity: 0;
                  transition: 0.15s ease-in;
              `};
`;

const Galeria = styled.div`
    width: 100%;
    height: 100%;
    background: var(--background);
    display: grid;
    overflow-y: auto;
`;

const Turnos = function ({ state }) {
    useEffect(() => {}, []);

    return (
        <>
            <Main state={state}>
                <p>
                    Apart con vista al mar y balcones terrazas con parrilla
                    individual a gas. Equipado con todos los utensilios para
                    cocinar, heladera con freezer, calefacci√≥n central, cable y
                    wifi. Parrillas en patio, SUM .
                </p>
                <Galeria />
            </Main>
        </>
    );
};

export default Turnos;
